import styles from "./NavigationItem.module.css"
export default function NavigationItem(props) {
    return (
        <li className={
            styles.NavigationItem
        }>
            <a 
            className={props.active ? styles.active : null}
            href={props.link}> 
            {props.children}
            </a>    
        </li>
    ) 
}
